import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
///import App from './App';
import * as serviceWorker from './serviceWorker';

const Abc = function App(props) {

    const message= this.props.message;
    return (
      <div className="App">
        <header className="App-header">
          <p>
            {message}
          </p>
        </header>
      </div>
    );
  }




ReactDOM.render(<Abc message="This is from Props"/>, document.getElementById('root'));

